export function createFormData(data: any): FormData {
  let formdata = new FormData();

  for (const key in data) {
    let value: any = data[key];
    let vt = typeof value;
    if (vt) {
    } else {
      formdata.append(key, value);
    }
  }

  return formdata;
}
